function minimumChanges(s: string, k: number): number {
    const n = s.length;
    const dp = Array.from({ length: k + 1 }, () => new Array(n + 1).fill(Infinity));
    const cost = (start: number, end: number) => {
        let changes = 0;
        while (start < end) {
            if (s[start] !== s[end]) changes++;
            start++;
            end--;
        }
        return changes;
    };

    dp[0][0] = 0;
    for (let i = 1; i <= k; i++) {
        for (let j = i; j <= n; j++) {
            if (i == 1) dp[i][j] = cost(0, j - 1);
            else {
                for (let l = i - 1; l < j; l++) {
                    dp[i][j] = Math.min(dp[i][j], dp[i - 1][l] + cost(l, j - 1));
                }
            }
        }
    }

    return dp[k][n];
}
